import "../Style/monitor.css"
import monitor from '../Images/Monitor/Monitor.svg';
import content from '../Images/Monitor/ContentAll.svg';
import screen1 from '../Images/Monitor/Screen1.svg';
import screen2 from '../Images/Monitor/Screen2.svg';
import screen3 from '../Images/Monitor/Screen3.svg';
import "@animxyz/core";
import { XyzTransition } from "@animxyz/react";


function Monitor() {
    return (
        <XyzTransition appearVisable duration="auto">
        <div id="monitorAnimation">
            <img id="monitor" src={monitor} alt="monitor" />
            <img id="content" src={content} alt="content" />
            <img id="screen1" appearVisable className="xyz-nested" xyz="fade small stagger ease-out-back duration-30" src={screen1} alt="screen1" />
            <img id="screen2" className="xyz-nested" xyz="fade small stagger ease-out-back duration-60" src={screen2} alt="screen2" />
            <img id="screen3" className="xyz-nested" xyz="fade small stagger ease-out-back duration-90" src={screen3} alt="screen3" />
        </div>
        </XyzTransition>
    );
}

export default Monitor;
